import Link from "next/link";
import styles from "./Nav.module.scss";

const Nav = (props) => {
  const {current} = props;
  console.log(current)
  return(
  <div className= {styles.nav} >
    <div className={styles.nav_wrapper}>
    <button id="book" className={styles.nav_button }><a href='http://www.secure-booker.com/angelamichael/MakeAppointment/Search.aspx'>Book</a></button>
    <button id="home" className={styles.nav_button}>
      <a className={ `${current=== 'home' ? 'current nav_link': 'nav_link'}`}  href='/'>Home</a></button>
    <button id="blog" className={styles.nav_button}>
      <a className={ `${current=== 'blog' ? 'current nav_link': 'nav_link'}`} href='/posts'>Blog</a>
      </button>
    </div>
  </div>
  )
};

export default Nav;
